import React from 'react';
import {auth , provider}  from './FirebaseConfig';

const GoogleSignIn = () => {

    const signIn = () => {
        auth.signInWithPopup(provider).catch(alert);
    }

    return (
        <div>
            <center>
                <button onClick={signIn}>Sign In with Google</button>
            </center>
        </div>
    );
}

export default GoogleSignIn;
